INSERT INTO `contest` VALUES (9,'CitizenLab2019','<p>CitizenLab2017</p>\r\n','CitizenLab2019','<p>CitizenLab2017</p>\r\n','2019-05-08 21:00:00','2019-05-09 17:00:00',1,1,NULL,10,NULL,'5ca5f0212594b.jpg',0,'2019-04-04 13:15:54','2019-06-12 14:19:22'),(13,'EaP Civil Society Hackathon 2019','The European Union is committed to supporting civil society in Eastern Partnership (EaP) countries, including through supporting the development of digital solutions for transparency, accountability, digital participation and public services. As a part of these efforts, in 2017-2020 the European Union&rsquo;s Eastern Partnership Civil Society Facility project organises a series of EaP regional hackathons. 2019 EaP Civil Society Hackathon is the third hackathon in the series.\r\n\r\nIt will bring together about 60 civil society activists, IT professionals and web-designers from six EaP countries &ndash; Armenia, Azerbaijan, Belarus, Georgia, Moldova and Ukraine &ndash; to Tbilisi, Georgia, to work face-to-face on software projects that would enable civil society better to contribute to reforms and democratic changes in their home countries.','Хакатон гражданского общества стран Восточного партнерства 2019','The European Union is committed to supporting civil society in Eastern Partnership (EaP) countries, including through supporting the development of digital solutions for transparency, accountability, digital participation and public services. As a part of these efforts, in 2017-2020 the European Union&rsquo;s Eastern Partnership Civil Society Facility project organises a series of EaP regional hackathons. 2019 EaP Civil Society Hackathon is the third hackathon in the series.\r\n\r\nIt will bring together about 60 civil society activists, IT professionals and web-designers from six EaP countries &ndash; Armenia, Azerbaijan, Belarus, Georgia, Moldova and Ukraine &ndash; to Tbilisi, Georgia, to work face-to-face on software projects that would enable civil society better to contribu