','Test 1','','2019-06-05 12:05:00','2019-06-05 15:10:00',0,1,NULL,10,NULL,'',0,'2019-06-05 14:54:27','2019-06-12 14:18:04'),(37,'2019 EaP Civil Society Hackathon','The EU-funded “Eastern Partnership Civil Society Facility” project seeks to promote the development of digital tools and solutions that would enable civil society organisations and activists better serve the needs of their communities, and help citizens participate in decision-making. To achieve this goal, the Project organises annual hackathon for civil society activists from the Eastern Partnership countries. The 2019 Hackathon in Tbilisi is the third even in the series. \r\nDuring the final presentations on June 16, you will vote for each digital solution except your own, and will assess the tools according to four criteria: feasibility, impact, sustainability and replication potential.\r\nWe will provide a ranking based on overall scores and will invite three teams to apply for funding for the full-fledge development and launch of the proposed IT-product: the two highest scoring teams based on the public vote and the highest scoring team based on the mentors’ vote.','Хакатон гражданского общества стран Восточного партнерства – 2019','Проект Европейского Европейский союза «Региональный механизм развития гражданского общества стран Восточного партнерства» активно поддерживает гражданское общество в разработке цифровых решений, которые помогут гражданским организациям и активистам отвечать на потребности населения, а гражданам – участвовать в принятии решений. С этой целью проект проводит ежегодные хакатоны для активистов из стран Восточного партнерства. Хакатон-2019 в Тбилиси стал третьим в рамках проекта. \r\nВо время финальных презентаций 16 июня вы проголосуете за каждое из представленных IT-решений, кроме своего собственного, по 4 критериям: реализуемость решения, эффективность воздействия, устойчивость продукта и потенциал масштабирования. \r\nМы подсчитаем баллы, и три решения, набравшие наибольшее количество баллов – два по мнению участников и одно по мнению менторов – будут приглашены подать заявки на получение финансирования от проекта для полномасштабной разработки и запуска IT-продукта.','2019-06-16 10:55:00','2019-06-16 14:45:00',0,1,NULL,10,NULL,'5d01fd6595a6a.jpg',1,'2019-06-13 12:07:36','2019-06-19 09:11:20');
